 ('1', '1', 'en_ie', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-13 11:04:16', '2017-10-13 11:05:55', '3bd24037-549e-4ee3-9c59-483681b74106'),
 ('2', '2', 'en_ie', 'Homepage', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Localhost will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', '<p>We create and provide the online services behind the biggest game titles in the world. We take on real challenges that affect almost half a billion players.</p>', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"en_ie\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Homepage\",\"seoDescription\":\"\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Homepage\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"custom\",\"seoDescriptionSourceField\":\"title\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"custom\",\"seoImageIdSourceField\":\"homeImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"homeImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"homeImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', NULL, NULL, NULL, NULL, NULL, 'We connect people to play online', 'If you’ve played, Call of Duty®, Destiny® and Skylanders™ or many other Activision titles; you’ve already interacted with the services that we create.', 'We have a commitment to open source. Our core focuses are Python, Erlang, C++, and MySQL.', 'Connect to get our latest events, jobs and news.', 'We work side-by-side with game studios at Activision.', 'Every studio and every title brings its own needs and personality which influence our approach.', 'Our offices are in Dublin, Ireland; Vancouver, Canada; and Shanghai, China, and we’re hiring in all locations.', 'Work with us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-13 11:04:19', '2018-01-26 10:31:35', 'c2912160-d722-4b64-8562-1933f1b339d0'),
 ('5', '5', 'en_ie', 'About Us', NULL, '<p>At Demonware we believe customer problems are our own, sharing wisdom breeds success, and everyone deserves respect. We work smart, deliver on promises, and have fun doing it.</p>', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"en_ie\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"About Us\",\"seoDescription\":\"At Demonware we believe customer problems are our own, sharing wisdom breeds success, and everyone deserves respect. We work smart, deliver on promises, and\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"About Us\",\"seoDescriptionUnparsed\":\"Since 1923, our business has been focussed on customer\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"intro\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"custom\",\"seoImageIdSourceField\":\"headerImage\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"headerImage\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"headerImage\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', NULL, NULL, NULL, NULL, NULL, 'Always Game', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>The services that we create touch every aspect of gameplay.</p>', '', NULL, NULL, NULL, NULL, NULL, '2017-10-13 14:00:45', '2018-01-25 23:50:57', '76906a27-5be7-4ecd-adc7-1a926e48c4da'),
 ('9', '9', 'en_ie', NULL, NULL, NULL, NULL, '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-13 14:23:03', '2017-12-04 23:29:49', '23ceb2a8-db4f-45df-9dfb-1ce352e6d976'),
 ('48', '48', 'en_ie', 'Careers', NULL, '<p>We are a technology-driven company with a culture of openness. This means collaborating to solve problems, the freedom to talk to anyone, and that the best idea wins.</p>', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"en_ie\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Careers\",\"seoDescription\":\"\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Careers\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"custom\",\"seoDescriptionSourceField\":\"title\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"custom\",\"seoImageIdSourceField\":\"headerImage\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"headerImage\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"headerImage\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', NULL, NULL, NULL, NULL, NULL, 'We take the work seriously; ourselves, not so much.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>We have a particular focus on team happiness, through extensive benefits and the atmosphere that we foster in the workplace. Our team enjoy flexible hours, paid training and generous vacation time.</p>', '[{\"col1\":\"Flexible working practices, based on the belief that the quality of your work is not dependent on the number of hours sitting behind a desk.\"},{\"col1\":\"A culture that emphasizes continual learning and improvement, with opportunities for career progression, travel, and a commitment to open source.\"},{\"col1\":\"Tax Saver commuter ticket scheme.\"},{\"col1\":\"Bike to work scheme.\"},{\"col1\":\"Free Activision games.\"},{\"col1\":\"Snacks 24\\/7\"}]', '[{\"col1\":\"Competitive salary, with annual performance reviews.\"},{\"col1\":\"25 days holidays.\"},{\"col1\":\"Annual bonus program.\"},{\"col1\":\"Annual pay review.\"},{\"col1\":\"Pension matching contributions.\"},{\"col1\":\"Top-tier healthcare for you and your family.\"},{\"col1\":\"Life insurance coverage.\"}]', '<p>We’re looking for passionate and engaged people who want to contribute to games played around the world. If you’re excited about working with technologies for low-latency, large scale distributed systems in a collaborative environment then we’d love to hear from you.</p>', '', '2017-12-04 23:13:13', '2018-01-25 15:22:15', 'e2cc07b4-0e82-498e-88a0-0d694b4ae527'),
 ('49', '49', 'en_ie', 'Debbie', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>It\'s rare that I find a place that I so quickly fit into and enjoy. Demonware not only takes care of their employees, but also helps them grow as both employees and human beings. The open communication between the employees and leadership quickly helps you feel like your opinion is valued and the fun office environment helps people to connect to one another.</p>', NULL, 'Office Coordinator / Vancouver', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:35:22', '2017-12-07 01:39:58', 'd0325a54-a506-453c-8078-afbf6437d0b1'),
 ('50', '50', 'en_ie', 'Damien', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Demonware is a great place to work. Working with great people, both at Demonware and in top game studios at Activision, on some of the biggest games entertainment franchises in the world is thrilling. On launch day, there\'s nothing quite like seeing that uniquely challenging project you\'ve worked on all year come to life on your games console at home, while you eagerly watch the user counts grow as each country comes on line.</p>', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:35:36', '2017-12-07 01:39:58', '4b3e7183-85d5-4372-9351-fef7d03a6be1'),
 ('51', '51', 'en_ie', 'Greg Smith', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>I like Demonware for a lot of reasons: I can be myself, and people accept it - which inspires and motivates me to be productive and creative. I am proud to be part of a world class brand (Activision), and be working on problems at scales that very few companies can claim to have reached.</p>', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:35:50', '2017-12-07 01:39:58', '0dac8170-81bc-46a9-a2f6-5948f5792ae1'),
 ('52', '52', 'en_ie', 'Infrastructure', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>The Infrastructure department designs, builds and operates our network of data centers and storage. We understand the challenges of scale and build for reliability.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:36:18', '2017-12-07 01:36:18', 'f5dacb22-b1e9-400f-b03f-b7f2ae2e16f7'),
 ('53', '53', 'en_ie', 'Products', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>The Products department creates game features. Alongside matchmaking, leaderboards, microtransactions, and identity management, we provide about 100 different services, touching almost every aspect of gameplay.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:36:27', '2017-12-07 01:36:27', '9d0707b4-4ab7-4fe2-be4a-d4ff0d38e85f'),
 ('54', '54', 'en_ie', 'Platforms', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>The Platforms department develops in-house services, frameworks and libraries. We create our own internal tools and tech to be efficient, responsive, and reusable.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:36:36', '2017-12-07 01:36:36', '170902f0-3779-45d7-9511-a6087c17b3cb'),
 ('55', '55', 'en_ie', 'Titles', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>The Titles department runs the services and infrastructure in live environments. We work side by side with game studios like Treyarch to execute innovative game designs and launch new titles smoothly each year.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:36:51', '2017-12-07 01:36:51', '2e58e0bb-032b-42ae-b799-99a4c44f7e3d'),
 ('56', '56', 'en_ie', 'Vancouver', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Our East Van location is convenient to Olympic Village and the Science Centre SkyTrain stop. Our spacious offices, spread across two floors, look out across the mountains.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:37:16', '2017-12-07 01:37:16', '1765e777-4418-4730-9808-8f13e9a42da4'),
 ('57', '57', 'en_ie', 'Dublin', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Located in Dublin’s vibrant city centre, we\'re close to shopping, cinemas and many, many pubs. Recently renovated, our top floor office enjoys panoramic views of they city\'s historic skyline.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:37:25', '2017-12-07 01:37:27', '2bc795c3-2e9b-46d3-99c3-34ba528e91be'),
 ('58', '58', 'en_ie', 'Shanghai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>We\'re based in one of Shanghai\'s central city districts with convenient access to line 1 metro. Our newly refurbished office is co-located with Raven Shanghai to support Activision\'s China game titles.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:37:38', '2017-12-07 01:37:38', '1caafa6e-673f-4299-950a-9ecf9ba1ed11'),
 ('59', '59', 'en_ie', 'Tendayi Mawushe', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, 'Software Architect', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:38:00', '2018-01-26 09:36:46', '9739223c-08a2-400e-87d1-91ec2c635d6c'),
 ('60', '60', 'en_ie', 'Suzanne Boylan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, 'Engineering Manager', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:39:00', '2018-01-26 09:36:51', '35c09bf5-ed9f-4e62-9c5c-7af79575dd8a'),
 ('61', '61', 'en_ie', 'Mike Whitty', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, 'Director of Engineering, Platform', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:39:08', '2018-01-26 09:36:56', '8a139bef-9456-441a-9a31-acabc3f48de5'),
 ('62', '62', 'en_ie', 'Nadia Alramli', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, 'Director of Engineering, Products', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:39:18', '2018-01-26 09:37:02', 'c8411046-6c79-43f4-9fb7-7a9665a711c6'),
 ('63', '63', 'en_ie', 'Colin Cashin', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, 'Director of Engineering, Infrastructure', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:39:25', '2018-01-26 09:37:07', '0b9ce570-5937-452e-aaca-7bd0b6aab31c'),
 ('64', '64', 'en_ie', 'Brendan Dillon', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, 'Director of Studio Operations', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:39:31', '2018-01-26 09:37:11', 'c52c949b-4b76-435e-81f6-ef37525cf0bf'),
 ('65', '65', 'en_ie', 'Matchmaking', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Putting all the right players together in one session, a few thousand times a second.</p>', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:40:44', '2018-01-25 23:33:34', '9e940571-0cdf-45a2-be08-a08fcb6c5c8b'),
 ('66', '66', 'en_ie', 'Leaderboards', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Ranking the winners, among friends or the best in the world.</p>', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:40:56', '2018-01-25 23:33:39', '9ad2cc40-b0f6-498e-85df-a18a47b6cba5'),
 ('67', '67', 'en_ie', 'Microtransactions', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Buying that bigger gun for the next raid, or a new hat because… new hat!</p>', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:41:10', '2018-01-25 23:33:45', '128b9654-d023-4164-9658-4d58d1983bbb'),
 ('68', '68', 'en_ie', 'Identity Management', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Recognising a player everywhere they log in.</p>', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:41:20', '2018-01-25 23:33:53', '29b2b348-aaa9-4648-8541-0fdf04038ec2'),
 ('69', '69', 'en_ie', 'Data Pipeline', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>Gathering every bit of information to make the next player experience better.</p>', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:41:30', '2018-01-25 23:34:00', '8c35c083-2c4b-4f94-8d36-9c932086e76c'),
 ('70', '70', 'en_ie', 'Treyarch', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Santa Monica, CA', '<p>Founded in 1996 and located in Santa Monica, California, Treyarch creates some of the best-selling, launch-day-record-breaking, widely known games in the world.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:44:22', '2017-12-07 01:44:22', 'b9fde56f-2d5e-411b-8b60-653af479f6c7'),
 ('71', '71', 'en_ie', 'Infinity Ward', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Los Angeles, CA', '<p>Founded in 2002, Infinity Ward is the original studio behind the Call of Duty franchise. Titles developed by Infinity Ward have won over 200 \"Game of the Year\" awards and 100 \"Editor\'s Choice\" awards, among many other industry accolades.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:44:38', '2017-12-07 01:44:38', 'b7aaa1a6-86c7-4842-8f88-c2a34d4ede5f'),
 ('72', '72', 'en_ie', 'Sledgehammer', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Silicon Valley, CA', '<p>Sledgehammer Games was founded in 2009 with a singular goal: Achieve Excellence. Their focus is providing players with a fun and entertaining experience in gaming.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:44:52', '2017-12-07 01:44:52', 'e6caf2db-3c99-4ee0-a18f-99a230187e8d'),
 ('73', '73', 'en_ie', 'High Moon Studios', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'San Diego, CA', '<p>High Moon Studios was established in 2005 and is located in Carlsbad, CA. We are focused on making highly successful AAA titles for PS3, Xbox 360 and PC.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:45:08', '2017-12-07 01:45:08', 'a16088a6-81cc-486d-a86a-97c354ef6e61'),
 ('74', '74', 'en_ie', 'Raven', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Madison, WI', '<p>Founded in 1990, Raven Software has gone from a five-person company with a dream of creating a role-playing game for the Amiga, to the developer of numerous award-winning games and best-selling titles.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:45:24', '2017-12-07 01:45:24', 'cd3033bb-184b-451e-9e32-362b83c97bae'),
 ('75', '75', 'en_ie', 'Vicarious Visions', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Albany, NY', '<p>Over the past two decades, Vicarious Visions has grown from a few friends working in their parents’ basement to a leading developer of console and handheld game software.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:45:39', '2017-12-07 01:45:39', '941ce8b2-1499-4595-9047-d5f878609455'),
 ('76', '76', 'en_ie', 'Toys for Bob', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Marin County, CA', '<p>Toys For Bob has been making games for over 20 years, and are the creators of the innovative Skylanders video game and toy franchise.</p>', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 01:45:57', '2017-12-07 01:45:57', '1c94a83a-52c4-494d-a7a7-a4216e4b57d0'),
 ('77', '77', 'en_ie', 'Dw About', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-07 13:26:17', '2018-01-26 09:35:21', '84d039fc-d009-4ce3-8d78-9e77672bc7e3'),
