 ('7', '2', '1', '1', 'en_ie', '6', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1507892659,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"22\":\"\",\"24\":\"Guidance & Vision for your SME\",\"3\":\"<p>Established in 1923, Finlay-Mulligan & Co. is a firm of&nbsp;Chartered Accountants and Registered Auditors based in&nbsp;Dublin, Ireland. We specialise in providing a full suite of&nbsp;accountancy services for small- to medium-sized&nbsp;businesses and professionals.<br><\\/p>\",\"4\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Homepage\",\"seoDescriptionSource\":\"custom\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"custom\",\"seoImageIdSourceField\":\"headerImage\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"headerImage\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"headerImage\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"25\":\"Planning and maintaining your financial success can time-consuming and complex, but it doesn\\u2019t have to be.\",\"27\":\"\",\"26\":\"<p>We have valuable experience and knowledge in a wide&nbsp;range of commercial activities. Whatever stage your&nbsp;business is at, we will advise you on the financial and&nbsp;taxation implications of each step along the way.<br><\\/p>\",\"23\":\"<p>Beyond an audit or accounting exercise we work closely with clients to help realise their potential: We take pride in seeing our clients\\u2019 businesses grow and flourish.<\\/p>\"}}', '2017-11-21 22:56:23', '2017-11-21 22:56:23', '17cb0140-016c-4b9f-81e3-85b9c2ea6e36'),
 ('8', '48', '9', '1', 'en_ie', '1', NULL, '{\"typeId\":\"9\",\"authorId\":null,\"title\":\"Careers\",\"slug\":\"careers\",\"postDate\":1512429193,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2017-12-04 23:13:13', '2017-12-04 23:13:13', 'd7f06839-e298-464f-8b99-93d65471f88d'),
 ('9', '48', '9', '1', 'en_ie', '2', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Careers\",\"slug\":\"careers\",\"postDate\":1512429193,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"51\":\"\",\"52\":\"\",\"53\":\"\",\"22\":\"\",\"24\":\"We take the work seriously; ourselves, not so much.\",\"3\":\"<p>We are a technology-driven company with a culture of openness. This means collaborating to solve problems, the freedom to talk to anyone, and that the best idea wins.<\\/p>\",\"4\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"\",\"seoDescriptionSource\":\"custom\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"custom\",\"seoImageIdSourceField\":\"headerImage\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"headerImage\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"headerImage\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"50\":\"\",\"49\":\"\",\"48\":\"\"}}', '2017-12-07 01:30:57', '2017-12-07 01:30:57', '1d2e7443-0c7d-4abf-8123-243e7e77f0cf'),
 ('10', '48', '9', '1', 'en_ie', '3', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Careers\",\"slug\":\"careers\",\"postDate\":1512429193,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"51\":[{\"col1\":\"Competitive salary, with annual performance reviews.\"},{\"col1\":\"25 days holidays.\"},{\"col1\":\"Annual bonus program.\"},{\"col1\":\"Annual pay review.\"},{\"col1\":\"Pension matching contributions.\"},{\"col1\":\"Top-tier healthcare for you and your family.\"},{\"col1\":\"Life insurance coverage.\"}],\"52\":\"<p><span class=\\\"s1\\\">We\\u2019re looking for passionate and engaged people who want to contribute to games played around the world. If you\\u2019re excited about working with technologies for low-latency, large scale distributed systems in a collaborative environment then we\\u2019d love to hear from you.<\\/span><span><\\/span><\\/p>\",\"53\":\"\",\"22\":\"\",\"24\":\"We take the work seriously; ourselves, not so much.\",\"3\":\"<p>We are a technology-driven company with a culture of openness. This means collaborating to solve problems, the freedom to talk to anyone, and that the best idea wins.<\\/p>\",\"4\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Careers\",\"seoDescriptionSource\":\"custom\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"custom\",\"seoImageIdSourceField\":\"headerImage\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"headerImage\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"headerImage\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"50\":[{\"col1\":\"Flexible working practices, based on the belief that the quality of your work is not dependent on the number of hours sitting behind a desk.\"},{\"col1\":\"A culture that emphasizes continual learning and improvement, with opportunities for career progression, travel, and a commitment to open source.\"},{\"col1\":\"Tax Saver commuter ticket scheme.\"},{\"col1\":\"Bike to work scheme.\"},{\"col1\":\"Free Activision games.\"},{\"col1\":\"Snacks 24\\/7\"}],\"49\":\"<p>We have a particular focus on team happiness, through extensive benefits and the atmosphere that we foster in the workplace. Our team enjoy flexible hours, paid training and generous vacation time.<\\/p>\",\"48\":\"\"}}', '2017-12-07 01:33:53', '2017-12-07 01:33:53', '7f9e416f-6d3b-42af-8f02-c12edc910854'),
 ('11', '49', '14', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Debbie\",\"slug\":\"debbie\",\"postDate\":1512610522,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"39\":\"<p>It\'s rare that I find a place that I so quickly fit into and enjoy. Demonware not only takes care of their employees, but also helps them grow as both employees and human beings. The open communication between the employees and leadership quickly helps you feel like your opinion is valued and the fun office environment helps people to connect to one another.<\\/p>\",\"42\":\"Office Coordinator \\/ Vancouver\"}}', '2017-12-07 01:35:22', '2017-12-07 01:35:22', 'b1c5d0a6-f851-4852-84d2-30bc4e15b3c3'),
 ('12', '49', '14', '1', 'en_ie', '2', '', '{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Debbie\",\"slug\":\"debbie\",\"postDate\":1512610500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"39\":\"<p>It\'s rare that I find a place that I so quickly fit into and enjoy. Demonware not only takes care of their employees, but also helps them grow as both employees and human beings. The open communication between the employees and leadership quickly helps you feel like your opinion is valued and the fun office environment helps people to connect to one another.<\\/p>\",\"42\":\"Office Coordinator \\/ Vancouver\"}}', '2017-12-07 01:35:25', '2017-12-07 01:35:25', 'acdba41a-1146-4f4b-b03a-2bb0384e2f21'),
 ('13', '50', '14', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Damien\",\"slug\":\"damien\",\"postDate\":1512610536,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"39\":\"<p>Demonware is a great place to work. Working with great people, both at Demonware and in top game studios at Activision, on some of the biggest games entertainment franchises in the world is thrilling. On launch day, there\'s nothing quite like seeing that uniquely challenging project you\'ve worked on all year come to life on your games console at home, while you eagerly watch the user counts grow as each country comes on line.<\\/p>\",\"42\":\"\"}}', '2017-12-07 01:35:36', '2017-12-07 01:35:36', '08762115-7d6a-49d1-b89e-55ca43e6da70'),
 ('14', '50', '14', '1', 'en_ie', '2', '', '{\"typeId\":\"14\",\"authorId\":\"1\",\"title\":\"Damien\",\"slug\":\"damien\",\"postDate\":1512610500,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"39\":\"<p>Demonware is a great place to work. Working with great people, both at Demonware and in top game studios at Activision, on some of the biggest games entertainment franchises in the world is thrilling. On launch day, there\'s nothing quite like seeing that uniquely challenging project you\'ve worked on all year come to life on your games console at home, while you eagerly watch the user counts grow as each country comes on line.<\\/p>\",\"42\":\"\"}}', '2017-12-07 01:35:43', '2017-12-07 01:35:43', '2ff1c098-104b-4bf0-977c-9568ed51ca36'),
 ('15', '51', '14', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Greg Smith\",\"slug\":\"greg-smith\",\"postDate\":1512610550,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"39\":\"<p>I like Demonware for a lot of reasons: I can be myself, and people accept it - which inspires and motivates me to be productive and creative. I am proud to be part of a world class brand (Activision), and be working on problems at scales that very few companies can claim to have reached.<\\/p>\",\"42\":\"\"}}', '2017-12-07 01:35:50', '2017-12-07 01:35:50', 'c8ef0bdd-37dd-4e9b-a10a-61e8d0004c82'),
 ('16', '52', '10', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Infrastructure\",\"slug\":\"infrastructure\",\"postDate\":1512610578,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>The Infrastructure department designs, builds and operates our network of data centers and storage. We understand the challenges of scale and build for reliability.<\\/p>\"}}', '2017-12-07 01:36:18', '2017-12-07 01:36:18', '6c1b27b9-8245-46ce-bfee-2901242b3d8f'),
 ('17', '53', '10', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Products\",\"slug\":\"products\",\"postDate\":1512610587,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>The Products department creates game features. Alongside matchmaking, leaderboards, microtransactions, and identity management, we provide about 100 different services, touching almost every aspect of gameplay.<\\/p>\"}}', '2017-12-07 01:36:27', '2017-12-07 01:36:27', '9dd6b6ce-c5c5-43dc-ada4-3a6d6b2805ba'),
 ('18', '54', '10', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Platforms\",\"slug\":\"platforms\",\"postDate\":1512610596,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>The Platforms department develops in-house services, frameworks and libraries. We create our own internal tools and tech to be efficient, responsive, and reusable.<\\/p>\"}}', '2017-12-07 01:36:36', '2017-12-07 01:36:36', 'b2d6f29b-86a5-46a9-9858-f0d8ff4f1db1'),
 ('19', '55', '10', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Titles\",\"slug\":\"titles\",\"postDate\":1512610611,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>The Titles department runs the services and infrastructure in live environments. We work side by side with game studios like Treyarch to execute innovative game designs and launch new titles smoothly each year.<\\/p>\"}}', '2017-12-07 01:36:51', '2017-12-07 01:36:51', '38fe7ea3-711c-4d52-9669-a0bdab7516cf'),
 ('20', '56', '15', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Vancouver\",\"slug\":\"vancouver\",\"postDate\":1512610636,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p><span class=\\\"s1\\\">Our East Van location is convenient to Olympic Village and the Science Centre SkyTrain stop. Our spacious offices, spread across two floors, look out across the mountains.<\\/span><span><\\/span><\\/p>\"}}', '2017-12-07 01:37:16', '2017-12-07 01:37:16', '91c19b77-0f37-4d60-8133-e98b3b63a978'),
 ('21', '57', '15', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Dublin\",\"slug\":\"dublin\",\"postDate\":1512610645,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>Located in Dublin\\u2019s vibrant city centre, we\'re close to shopping, cinemas and many, many pubs. Recently renovated, our top floor office enjoys panoramic views of they city\'s historic skyline.<\\/p>\"}}', '2017-12-07 01:37:25', '2017-12-07 01:37:25', '573b6055-8f7e-479a-9a7f-ff70de357e40'),
