 ('32', '70', '13', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Treyarch\",\"slug\":\"treyarch\",\"postDate\":1512611062,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>Founded in 1996 and located in Santa Monica, California, Treyarch creates some of the best-selling, launch-day-record-breaking, widely known games in the world.<\\/p>\",\"41\":\"\",\"38\":\"Santa Monica, CA\",\"40\":\"\"}}', '2017-12-07 01:44:22', '2017-12-07 01:44:22', '4fba39d2-4eae-455d-a3e2-da4fb63c1770'),
 ('33', '71', '13', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Infinity Ward\",\"slug\":\"infinity-ward\",\"postDate\":1512611078,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>Founded in 2002, Infinity Ward is the original studio behind the Call of Duty franchise. Titles developed by Infinity Ward have won over 200 \\\"Game of the Year\\\" awards and 100 \\\"Editor\'s Choice\\\" awards, among many other industry accolades.<\\/p>\",\"41\":\"\",\"38\":\"Los Angeles, CA\",\"40\":\"\"}}', '2017-12-07 01:44:38', '2017-12-07 01:44:38', 'f82ffd85-9818-4ddb-b248-929813b2f70e'),
 ('34', '72', '13', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Sledgehammer\",\"slug\":\"sledgehammer\",\"postDate\":1512611092,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>Sledgehammer Games was founded in 2009 with a singular goal: Achieve Excellence. Their focus is providing players with a fun and entertaining experience in gaming.<\\/p>\",\"41\":\"\",\"38\":\"Silicon Valley, CA\",\"40\":\"\"}}', '2017-12-07 01:44:52', '2017-12-07 01:44:52', '502ef2b2-aeac-470a-9e3c-537930d8a139'),
 ('35', '73', '13', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"High Moon Studios\",\"slug\":\"high-moon-studios\",\"postDate\":1512611108,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>High Moon Studios was established in 2005 and is located in Carlsbad, CA. We are focused on making highly successful AAA titles for PS3, Xbox 360 and PC.<\\/p>\",\"41\":\"\",\"38\":\"San Diego, CA\",\"40\":\"\"}}', '2017-12-07 01:45:08', '2017-12-07 01:45:08', '9a140e3f-0b33-4c19-a6b3-1e7105ee2362'),
 ('36', '74', '13', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Raven\",\"slug\":\"raven\",\"postDate\":1512611124,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>Founded in 1990, Raven Software has gone from a five-person company with a dream of creating a role-playing game for the Amiga, to the developer of numerous award-winning games and best-selling titles.<\\/p>\",\"41\":\"\",\"38\":\"Madison, WI\",\"40\":\"\"}}', '2017-12-07 01:45:24', '2017-12-07 01:45:24', '99009f5a-193d-4a70-8d07-bdbd4bfcc451'),
 ('37', '75', '13', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Vicarious Visions\",\"slug\":\"vicarious-visions\",\"postDate\":1512611139,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>Over the past two decades, Vicarious Visions has grown from a few friends working in their parents\\u2019 basement to a leading developer of console and handheld game software.<\\/p>\",\"41\":\"\",\"38\":\"Albany, NY\",\"40\":\"\"}}', '2017-12-07 01:45:40', '2017-12-07 01:45:40', 'a1a18592-0fdd-40c9-b2d3-4552adec5d28'),
 ('38', '76', '13', '1', 'en_ie', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Toys for Bob\",\"slug\":\"toys-for-bob\",\"postDate\":1512611157,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"39\":\"<p>Toys For Bob has been making games for over 20 years, and are the creators of the innovative Skylanders video game and toy franchise.<\\/p>\",\"41\":\"\",\"38\":\"Marin County, CA\",\"40\":\"\"}}', '2017-12-07 01:45:57', '2017-12-07 01:45:57', '68762565-60e2-4a84-8185-29278862e6f6'),
 ('39', '48', '9', '1', 'en_ie', '4', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Careers\",\"slug\":\"careers\",\"postDate\":1512429193,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"51\":[{\"col1\":\"Competitive salary, with annual performance reviews.\"},{\"col1\":\"25 days holidays.\"},{\"col1\":\"Annual bonus program.\"},{\"col1\":\"Annual pay review.\"},{\"col1\":\"Pension matching contributions.\"},{\"col1\":\"Top-tier healthcare for you and your family.\"},{\"col1\":\"Life insurance coverage.\"}],\"52\":\"<p>We\\u2019re looking for passionate and engaged people who want to contribute to games played around the world. If you\\u2019re excited about working with technologies for low-latency, large scale distributed systems in a collaborative environment then we\\u2019d love to hear from you.<\\/p>\",\"53\":\"\",\"22\":[\"78\"],\"24\":\"We take the work seriously; ourselves, not so much.\",\"3\":\"<p>We are a technology-driven company with a culture of openness. This means collaborating to solve problems, the freedom to talk to anyone, and that the best idea wins.<\\/p>\",\"4\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Careers\",\"seoDescriptionSource\":\"custom\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"custom\",\"seoImageIdSourceField\":\"headerImage\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"headerImage\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"headerImage\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransfo