 ('48', 'field', '3', 'en_ie', ' we are a technology driven company with a culture of openness this means collaborating to solve problems the freedom to talk to anyone and that the best idea wins '),
 ('48', 'field', '48', 'en_ie', ' photo photo1 photo photo1 '),
 ('48', 'field', '49', 'en_ie', ' we have a particular focus on team happiness through extensive benefits and the atmosphere that we foster in the workplace our team enjoy flexible hours paid training and generous vacation time '),
 ('48', 'field', '51', 'en_ie', ' competitive salary with annual performance reviews competitive salary with annual performance reviews 25 days holidays 25 days holidays annual bonus program annual bonus program annual pay review annual pay review pension matching contributions pension matching contributions top tier healthcare for you and your family top tier healthcare for you and your family life insurance coverage life insurance coverage '),
 ('48', 'field', '50', 'en_ie', ' flexible working practices based on the belief that the quality of your work is not dependent on the number of hours sitting behind a desk flexible working practices based on the belief that the quality of your work is not dependent on the number of hours sitting behind a desk a culture that emphasizes continual learning and improvement with opportunities for career progression travel and a commitment to open source a culture that emphasizes continual learning and improvement with opportunities for career progression travel and a commitment to open source tax saver commuter ticket scheme tax saver commuter ticket scheme bike to work scheme bike to work scheme free activision games free activision games snacks 24 7 snacks 24 7 '),
 ('48', 'field', '52', 'en_ie', ' we re looking for passionate and engaged people who want to contribute to games played around the world if you re excited about working with technologies for low latency large scale distributed systems in a collaborative environment then we d love to hear from you '),
 ('48', 'field', '53', 'en_ie', ''),
 ('48', 'field', '4', 'en_ie', ' 1 en_ie 1 0 template creativework webpage careers careers field title custom title custom title custom headerimage custom headerimage custom headerimage '),
 ('49', 'field', '42', 'en_ie', ' office coordinator vancouver '),
 ('49', 'field', '39', 'en_ie', ' it s rare that i find a place that i so quickly fit into and enjoy demonware not only takes care of their employees but also helps them grow as both employees and human beings the open communication between the employees and leadership quickly helps you feel like your opinion is valued and the fun office environment helps people to connect to one another '),
 ('49', 'slug', '0', 'en_ie', ' debbie '),
 ('49', 'title', '0', 'en_ie', ' debbie '),
 ('50', 'field', '42', 'en_ie', ''),
 ('50', 'field', '39', 'en_ie', ' demonware is a great place to work working with great people both at demonware and in top game studios at activision on some of the biggest games entertainment franchises in the world is thrilling on launch day there s nothing quite like seeing that uniquely challenging project you ve worked on all year come to life on your games console at home while you eagerly watch the user counts grow as each country comes on line '),
 ('50', 'slug', '0', 'en_ie', ' damien '),
 ('50', 'title', '0', 'en_ie', ' damien '),
 ('51', 'field', '42', 'en_ie', ''),
 ('51', 'field', '39', 'en_ie', ' i like demonware for a lot of reasons i can be myself and people accept it which inspires and motivates me to be productive and creative i am proud to be part of a world class brand activision and be working on problems at scales that very few companies can claim to have reached '),
 ('51', 'slug', '0', 'en_ie', ' greg smith '),
 ('51', 'title', '0', 'en_ie', ' greg smith '),
 ('52', 'field', '39', 'en_ie', ' the infrastructure department designs builds and operates our network of data centers and storage we understand the challenges of scale and build for reliability '),
